// src/components/News.js
import React, { useState, useEffect } from 'react';
import { fetchNews } from '../services/newsService'; // Update import

const News = () => {
  const [news, setNews] = useState([]);

  useEffect(() => {
    const getNewsData = async () => {
      try {
        const newsData = await fetchNews(); // Use fetchNews instead of getNews
        setNews(newsData);
      } catch (error) {
        console.error('Error fetching news:', error);
      }
    };

    getNewsData();
  }, []);

  return (
    <div>
      <h1>Latest News</h1>
      <ul>
        {news.map((article, index) => (
          <li key={index}>{article.title}</li>
        ))}
      </ul>
    </div>
  );
};

export default News;
